INSERT INTO `mbti` VALUES (1,'INTJ-A / INTJ-T','Introvert, Intuition, Thinking, Judgement\r\n\r\nSeseorang yang berkepribadian (Baca: Psikologi Kepribadian ) INTJ sering disebut pengatur atau The Masterminds. Hanya ada 2-4% populasi INTJ di dunia. Dimana menurut dimensinya INTJ berarti Introversion atau seseorang yang tidak suka akan hubungan dan dunia luar. Intuition dimana mereka membicarakan hal yang bersifat masa depand an belum jelas atau abstrak. Thinking merupakan dimensi dasar mereka dimana mereka suka menilai dan berpikir sebelum bertindak dan sangat objektif. Judging merupakan mereka yang merencanakan berbagai hal sebelum bertindak.\r\n\r\nCiri khas INTJ adalah :\r\n- Ahli dalam mengatur strategi atau melihat gambaran secara global.\r\n- Menyukai tantangan teoritis yang sulit.\r\n- Menghargai nilai pengetahuan dan efisiensi.\r\n- Mampu menyerap teori yang kompleks dan terdorong untuk menciptakan keteraturan dan struktur dari abstraksi teoritis.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Cobalah untuk mengungkapkan berbagai hal dengan benar dan hargai banyak orang, jangan mengikuti perdebatan yang tidak penting.\r\n- Belajar untuk berempati dan peka terhadap orang lain.\r\n- Pekerjaan yang cocok adalah analisis, dokter, pimpinan perusahaan, ahli keilmuan, insinyur dan hakim.\r\n\r\nAsmara yang cocok bersama INTJ adalah mereka yang ENFP dan ENTP, namun pemilihan pasangan ini bukan alasan anda untuk membatasi pencarian pasangan anda.',NULL,'2021-01-21 01:50:15',NULL),(2,'ENTJ-A / ENTJ-T','Extrovert, Intuitive, Thinking, dan Judging\r\n\r\nPribadi selanjutnya adalah ENTJ yang merupakan salah satu pribadi yang unik. Mereka biasa disebut Fieldmarshal atau panglima. Dimana sesuai dimensinya ENTJ merupakan pribadi yang Extroversion atau terbuka dan memiliki hubungan dan jaringan luas dengan siapapun, Intuition yakni orang yang senang akan hal abstrak dan belum jelas tujuannya.\r\n\r\nThinking, yakni pribadi yang menilai berbagai hal secara objektif apapun alasannya. Terakhir yakni Judging dimana anda senang mengambil keputusan dan membuat rencana dulu baru menjalankannya. Ada sekitar 2-5% populasi ENTJ di dunia.\r\n\r\nDengan ciri khas kepribadian yakni :\r\n-Tidak menyukai rutinitas yang beroritentasi pada detail dalam menyelesaikan tugas.\r\n- Pemimpin alami dan percaya diri yang tinggi.\r\n- Menginginkan hal yang teratur dan jelas di masa depannya.\r\n- Tak sabar dengan sesuatu yang dianggap tak efisien, dan tidak terpatok pada rencana saja melainkan dilakukan secara cepat.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Belajarlah untuk relaks, tidak semua hal berjalan sesuai keinginan dan tidak semua bisa berjalan dengan perfeksionis.\r\n- Belajar untuk kendalikan emosi dan jangan jadi pemarah. Apalagi jangan terlalu arogan, karena terlalu arogan menimbulkan hal yang menjadikan hal hal hancur dan bukan berhasil.\r\n- Coba kelola emosi dengan baik, seorang panglima memang sulit mengetahui perasaan orang lain meskipun anda bisa memimpin dengan baik.\r\n- Pekerjaan yang cocok adalah pengusaha, hakim, profesor, konsultan komputer dan manajer.\r\n- Saran hubungan yakni ENTJ sangat cocok berpasangan dengan ISTP dan INTP, mereka memiliki beberapa kesamaan yang menghubungkan.',NULL,'2021-01-21 01:50:42',NULL),(3,'INTP-A / INTP-T','Introvert, Intuitive, Thinking, Perceiving.\r\n\r\nAnda yang memiliki kepribadian INTP biasa disebut sebagai The Thinkers atau seorang pemikir. Diperkirakan 3-5% kepribadian INTP di dunia. Menurut dimensinya INTP yakni Introversion yaitu orang yang senang akan hal yang tenang dan tidak terlalu suka mengenal dunia luas. Intuition, yakni mereka yang sebenarnya menyukai hal abstrak dan berkaitan dengan masa depan. Thinking yaitu mereka yang berpikir objektif tanpa melihat siapapun itu, dan Perception dimana mereka membuat keputusan berdasarkan kesepakatan.\r\n\r\nCiri khas kepribadian INTP adalah: \r\n- Kreatif, berwawasan, briliant an juga berbakat.\r\n- Menilai pengetahuan dan kompetensi di atas segalanya.\r\n- Memiliki standar yang sangat tinggi kinerja yang mereka terapkan untuk diri mereka sendiri.\r\n- Pencari kebenaran dan membawa prinsip yang teguh.\r\n- Kehidupan utamanya ada dalam pikiran mereka, mungkin tampak telepas dan tidak terlibat dengan orang lain.\r\n\r\nSaran dan pekerjaan yang cocok:\r\nBelajarlah untuk menjadi seseorang yang memahami dan mengerti perasaan orang lain apalagi menghargainya karena bisa saja orang lain lebih tinggi dari anda. Cobalah menemukan ide dan mewujudkannya jangan hanya berpikir dan menyusun teori tanpa ada wujud dan tujuan jelasnya.\r\nPekerjaan yang cocok adalah Programmer, penulis teknis, penyidik forensic, hakim, ilmu kehutanan dan juga ahli ilmu eksak.\r\n\r\nAsmara yang cocok dengan INTP adalah seseorang yang memiliki kepribadian ESTJ atau ENTJ yang mana tidak akan saling mendominasi dan sama-sama bermodalkan hal yang bersifat thinking atau berpikir agar masih bisa berkaitan dalam satu dunia atau satu pemikiran.',NULL,'2021-01-21 01:51:05',NULL),(4,'ENTP-A / ENTP-T','Extrovert, Intuitive, Thinking, Perceiving.\r\n\r\nSekitar 2-5% orang memiliki kepribadian ENTP di dunia. Dimana ENTP biasa disebut The visionaries atau penemu. Menurut dimensinya, ENTP merupakan pribadi yang Extroversion yakni memiliki hubungan dan jaringan luas dengan siapapun dan dimanapun. Intuition yakni mereka yang mendulukan hal abstrak dibandingkan hal yang konkrit.\r\n\r\nThinking yakni mereka yang menggunakan akal pikiran dan selalu memilih keputusan yang objektif. Serta Perception, dimana mereka akan menyesuaikan berbagai hal dan membuka segala sesuatu dengan orang lain tanpa memutuskan hal terlebih dahulu. \r\n\r\nCiri khas kepribadian ENTP adalah :\r\n- Merasa senang ketika bisa membantu dan juga menunjukan semangat yang tinggi.\r\n- Logis dan pemikir rasional serta fleksibel dan cerdas.\r\n- Senang memperdebatkan suatu masalah dan membuktikannya, mampu bersikap fleksibel dan multi talenta.\r\n- Seorang pemimpin yang baik dan tidak memaksa, serta menghargai pengetahuan serta kompetensi setiap orangnya..\r\n- seseorang yang senang bergerak dan juga aktif \r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Jangan ingin menang sendiri dan cobalah lakukan win win solution.\r\n- Hindari perdebatan tidak penting dan disiplinkan diri sendiri.\r\n- Belajar untuk memberikan perhatian dan belajar untuk lebih waspada agar tidak terlalu optimis.\r\n- Pekerjaan yang cocok adalah psikolog (Baca: Prospek Kerja Lulusan Psikologi), pengacara, konsultan, insinyur, aktor, keilmuan, programer, pebisnis dan pemasaran.\r\n\r\nSaran untuk pasangan yang cocok untuk pribadi ENTP adalah mereka yang INFJ atau INTJ. Dengan begitu mereka akan seimbang dan tentu tidak ada yang mendominasi.',NULL,'2021-01-21 01:51:36',NULL),(5,'INFJ-A / INFJ-T','Introvert, Intuition, Feeling, Judging.\r\n\r\n\r\nSeseorang yang berkepribadian INFJ sering disebut the counselor atau penasihat.  Hanya ada 1-3% populasi  INFJ di dunia. Dimana menurut dimensinya INFJ berarti Introversion atau seseorang yang tidak suka akan hubungan dan dunia luar. Intuition dimana mereka membicarakan hal yang bersifat masa depand an belum jelas atau abstrak. Feeling yaitu mereka memutuskan berbagai hal dengan perasaan dan menyangkut pribadi serta Judging yang mana mereka mengutamakan rencana baru melakukan hal selanjutnya. \r\n\r\nCiri kepribadian  INFJ adalah:\r\n- Berorientasi pada masa depan dan berpikiran secara kompleks serta mendalam.\r\n- Berkomitmen, penuh ide, perfeksionis, dan juga pendiam. Sayangnya terkadang mereka sering mengekspresikan hal yang dianggap tidak ramah dan berempati.\r\n- Tak suka berurusan dengan hal yang rinci dan juga sulit.\r\n- Mengenali apa potensi diri mereka. (baca: Cara Mengenali Potensi Diri)\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Seimbangkan pandangan anda jangan terlalu melihat hal ke arah negative atau buruk ‘’bersabar dan rilekslah, dan jangan paksakan apa yang menjadi hal yang tidak bisa anda kerjakan\r\n- Pekerjaan yang cocok adalah penasihat, Psikolog (Baca: Konsep diri dalam Ilmu Psikologi) , pekerja sosial, dokter, tenaga kesehatan, pemerhati anak dan pemasaran\r\n\r\nAsmara untuk INFJ adalah mereka yang memiliki kepribadian ENFP atau ENTP yang mungkin lebih bisa mengimbangi pribadi INFJ.',NULL,'2021-01-21 01:51:55',NULL),(6,'ENFJ-A / ENFJ-T','Extrovert, Intuition, Feeling, Judging.\r\n\r\nENFJ merupakan mereka yang memiliki kepribadian Extraversion, Intuition, Feeling dan Judging. Didunia ini hanya ada 2-5% populasi ENFJ di dunia. Dimana menurut dimensinya, ENFJ dijelaskan sebagai seseorang yang Extraversion yaitu mereka yang memiliki hubungan atau jaringan perkenalan yang luas.\r\n\r\nIntuition yakni mereka yang cenderung menyukai hal abstrak dibandingkan hal detail. Feeling atau perasaan, mereka merupakan orang yang menghargai pertimbangan pribadi. Sedangkan Judgement merupakan mereka yang merencanakan kegiatan barulah menunjukan aksinya. \r\n\r\nCiri umum ENFJ adalah :\r\n- Benar-benar hangat dan senang memegang nilai atau perasaan tentang orang lain.\r\n- Memegang nilai harmoni dan memiliki keterampilan yang sangat baik.\r\n- Benci hal-hal berlogika impersonal dan analisis.\r\n- Loyal dan juga jujur serta kreatif dan imajinatif.\r\n- Menyukai tantangan baru dan sensitif terhadap kritik serta perpecahan.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Untuk anda yang ENFJ sebaiknya coba untuk sering mengorbankan diri untuk orang lain.\r\n- Jangan mengukur harga diri dengan memperlakukan orang lain, dan jangan mudah kecewa jika mereka tidak seperti yang diinginkan.\r\n- Pekerjaan yang cocok diantaranya adalah Pekerja sosial, manajer, pengelola SDM, penulis, fasilitator, psikolog, konsultan dan juga politikus.\r\n\r\nPasangan yang cocok untuk ENFJ adalah mereka yang INFP atau ISFP. Namun hal ini tidak bisa menghalangi anda untuk memilih pasangan yang cocok tanpa melihat MBTI dan pilihlah pasangan yang anda cintai.',NULL,'2021-01-21 01:52:12',NULL),(7,'INFP-A / INFP-T','Introvert, Intuitive, Feeling, Perceiving.\r\n\r\nKepribadian manusia sangatlah beragam (Baca: Tipe Kepribadian Manusia) salah satunya adalah INFP sering disebut the idealist atau seseorang yang idealis.  Hanya ada 4-5% populasi INFP di dunia. Dimana menurut dimensinya INFP berarti Introversion atau seseorang yang tidak suka akan hubungan dan dunia luar. Intuition dimana mereka membicarakan hal yang bersifat masa depan dan belum jelas atau abstrak. Feeling yaitu mereka memutuskan berbagai hal dengan perasaan dan menyangkut pribadi serta Perception  yakni pemikiran yang terbuka dan cenderung menunda keputusan demi kesepakatan. \r\n\r\nCiri khas INFP adalah:\r\n- Loyal dan biasanya mengabdikan diri untuk orang lain.\r\n- Fleksibel, santai, kreatif dan memegang prinsip.\r\n- Sangat sensitive dan juga kompleks, dimana mereka tidak suka bekerja dengan rutunitas dan mementingkan hasil akhir.\r\n- Selalu ingin berkembang dan tidak ingin diam di tempat.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Jangan terlalu menyalahkan diri sendiri ketika mengalami hal yang membuat anda hancur dan target yang tidak tercapai.\r\n- Jangan terlalu baik ataupun terlalu keras pada orang lain semua memiliki porsinya masing-masing.\r\n- Belajar untuk bersikap tegas dan juga terbuka, jangan lakukan apapun secara diam-diam dan menyakiti orang lain:\r\n- Pekerjaan yang cocok adalah guru, penasihat, pekerja keagamaan, penulis dan professor.\r\n\r\nAsmara untuk INFP adalah mereka yang memiliki kepribadian ENFJ atau ESFJ yang mungkin lebih bisa mengimbangi pribadi INFP.',NULL,'2021-01-21 01:52:35',NULL),(8,'ENFP-A / ENFP-T','Extrovert, Intuitive, Feeling, Perceiving.\r\n\r\nENFP merupakan mereka yang memiliki kepribadian Extraversion, Intuition, Feeling dan Perception. Didunia ini hanya ada 6-8% di dunia. Menurut dimensinya Extraversion merupakan seseorang yang bisa berinteraksi dengan luas dan menikmatinya. Intuition yakni cenderung menyukai hal yang abstrak dibanding realita yang ada. Feeling yakni menggunakan pertimbangan pribadi dalam mengambil keputusan dibandingkan logika. Lalu terakhir adalah Perception, dimana mereka cenderung menahan pendapat dan menunda keputusan untuk mencapai kesepakatan bersama.\r\n\r\nCiri umum ENFP adalah:\r\n- Berorientasi pada proyek.\r\n- Cerdas dan mampu serta hangat sehingga membuat banyak orang tertarik.\r\n- Sangat intuitif dan perseptif tentang orang lain.\r\n- Dapat bekerja sama dan memiliki keterampilan komunikasi verbal yang baik.\r\nCenderung menempatkan kebutuhan orang lain dibanding dirinya sendiri.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Belajar fokus dan juga disiplin, tegas serta konsisten.\r\n- Pikirkan kebutuhan sendiri karena memikirkan diri sendiri juga penting,\r\n- Jangan terlalu boros dan coba untuk kelola uang dengan baik.\r\n- Belajar untuk hadapi konflik dan permasalahan, jangan lari atau menutupi.\r\n- Pekerjaan yang cocok yakni guru, penasihat, konsultan, pengusaha, reporter, pakar ilmu pengetahuan, insinyur dan seniman.\r\n\r\nPasangan yang cocok untuk ENFP adalah mereka yang INTJ atau INFJP. Namun hal ini tidak bisa menghalangi anda untuk memilih pasangan yang cocok tanpa melihat MBTI.',NULL,'2021-01-21 01:52:52',NULL),(9,'ISTJ-A / ISTJ-T','Introvert, Sensing, Thinking, Judging.\r\n\r\nSeseorang yang berkepribadian ISTJ sering disebut The Inspector atau pengawas.  Ada sangat banyak pribadi yang termasuk ISTJ yakni 11-14% populasi di dunia. Dimana menurut dimensinya ISTJ berarti Introversion atau seseorang yang tidak suka akan hubungan dan dunia luar. Sensing yaitu mereka yang mengenal hal-hal secara konkret atau nyata Thinking merupakan dimensi dasar mereka dimana mereka suka menilai dan berpikir sebelum bertindak dan sangat objektif. Judging merupakan mereka yang merencanakan berbagai hal sebelum bertindak. \r\n\r\nCiri kepribadian ISTJ adalah:\r\n- Menjunjung nilai tradisi dan juga sosok yang mampu bekerja keras dan menyelesaikan waktu tugas dengan tepat\r\n- Mereka sering disebut berkepribadian ganda (Baca: Kepribadian Ganda)  meskipun sebenarnya tidak.\r\n- Menyukai teori abstrak dan melihat aplikasi praktis.\r\n- Pemimpin alami.\r\n- Suka bekerja sendiri dan baik juga didalam tim.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Belajar memahami perasaan orang lain dan kontrol keinginan anda untuk menguasai orang lain secara berlebih.\r\n- Lihat lebih banyak sisi positif dibandingkan sisi negative seseorang.\r\n- Terbukalah pada perubahan.\r\n- Pekerjaan yang cocok adalah akuntan, dokter, pengacara, dokter gigi dan juga sistem analis.\r\nStabil, praktis, dan berorientasi pada keluarga.\r\n\r\nAsmara untuk ISTJ adalah mereka yang memiliki kepribadian ESFP atau ESTP yang mungkin lebih bisa mengimbangi pribadi ISTJ.',NULL,'2021-01-21 01:53:13',NULL),(10,'ESTJ-A / ESTJ-T','Extrovert, Sensing, Thinking, Judging.\r\n\r\nAnda yang memiliki kepribadian ESTJ biasa disebut sebagai The Guardians atau pelindung. Ada banyak yakni  8-12% kepribadian ESTJ di dunia. Menurut dimensinya ESTJ adalah Extroversion yaitu mereka yang bisa membangun jaringan dengan luas. Sensing, yakni mereka yang tidak suka akan hal abstrak dan lebih suka hal konkret. Kemudian Thinking yakni mereka yang berpikir objektif dalam berbagai hal dan Judging, yakni mereka yang senang membuat rencana dulu baru menjalankannya. \r\n\r\nCiri khas ESTJ adalah:\r\n- Pemimpin dan pelindung yang alami.\r\n- Memiliki aturan standar dan sering disebut kaku atau tradisional.\r\n- Biasanya gemar akan kesehatan atau olahraga.\r\n- Senang menciptakan ketertiban dan sangat teliti.\r\n- Berterus terang dan juga jujur.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Kurangi untuk mengontrol dan memaksa orang lain.\r\n- Introspeksi diri dan jangan lupa untuk mengendalikan amarah.\r\n- Cobalah untuk lebih sabar dan pelajari psikologi faal yang berkaitan antara batin dan kesehatan tubuh.\r\n- Pekerjaan yang cocok adalah hakim, polisi, pimpinan militer, petugas keuangan dan detektif.\r\n\r\nAsmara yang cocok dengan ESTJ adalah seseorang yang memiliki kepribadian ISTP atau INTJ yang mana tidak akan saling mendominasi dan juga menenangkan.',NULL,'2021-01-21 01:53:28',NULL),(11,'ISFJ-A / ISFJ-T','Introvert, Sensing, Feeling, Judging\r\n\r\nSeseorang yang berkepribadian ISFJ sering disebut the nurturers atau pengasuh.  Ada banyak pribadi yang termasuk ISFJ yakni 9-14% populasi di dunia. Dimana menurut dimensinya ISFJberarti Introversion atau seseorang yang tidak suka akan hubungan dan dunia luar. Sensing yaitu mereka yang mengenal hal-hal secara konkret atau nyata.  Feeling yaitu mereka memutuskan berbagai hal dengan perasaan dan menyangkut pribadi serta Judging yang mana mereka mengutamakan rencana baru melakukan hal selanjutnya. \r\n\r\nCiri kepribadian ISFJ adalah:\r\n- Stabil, prakti dan bersahaja karena mereka tidak suka bekerja dengan pemikiran yang abstrak.\r\n- Sangat jeli dan memahami perasaan orang lain.\r\n- Seseorang yang kaya akan informasi dan juga bekerja keras dalam waktu yang lama untuk mendapatkan hasil yang diinginkan.\r\n- Memegang nilai keamanan dan juga tradisi hidup secara damai.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Belajar mengatakan tidak jika tidak suka dan cobalah untuk lebih antusias dalam melakukan berbagai hal.\r\n- Jangan terjebak zona nyaman dan cobalah hal lainnya.\r\n- Asisten administrasi, desainer, perawat, pemimpin usaha, pemilik toko, pembantu pengacara, dan juga pengelola atau manajer.\r\n\r\nAsmara untuk ISFJ adalah mereka yang memiliki kepribadian ESFP atau ESTP yang mungkin lebih bisa mengimbangi pribadi ISFJ.',NULL,'2021-01-21 01:53:52',NULL),(12,'ESFJ-A / ESFJ-T','Extrovert, Sensing, Feeling, Judging\r\n\r\nKepribadian ESFJ biasa juga disebut the caregiver atau mereka yang senang memberi, di dunia ini masih ada 9-13% pribadi ESFJ di dunia, dan masih bisa dikatakan cukup banyak. Dalam dimensinya ESFJ berarti Extroversion, dengan pribadi yang terbuka dan senang dalam berbagi apapun dan memiliki banyak teman. Sensing, dimana mereka menggunakan  hal yang konkret dibandingkan hal abstrak atau tidak jelas. Feeling, merupakan pribadi ESFJ dimana mereka menggunakan perasaan pribadi dalam menentukan keputusan, serta Judging. Yakni mereka yang lebih suka membuat perencanaan terlebih dahulu baru menjalankannya. \r\n\r\nCiri dari kepribadian ESFJ adalah :\r\n- Sangat loyal, teroganisir dan juga bisa diandalkan.\r\n- Anak teladan, menciptakan hal yang damai dan rapih serta structural dan tidak melenceng.\r\n- Cenderung menempatkan kebutuhan orang lain dan sangat baik dalam memberikan perawatan praktis.\r\n- Tidak suka berteori tentang masa depan dan memikirkan hal yang harus dipikirkan saat ini.\r\n\r\nSaran dan pekerjaan  yang cocok:\r\n- Jangan mengorbankan diri sendiri terus, anda juga harus memikirkan kebutuhan pribadi.\r\n- Jangan mengukur harga diri dari perlakuan dan pujian, karena bisa saja hal tersebut palsu adanya.\r\n- Terima tanggung jawab hidup dan jangan menghindari konflik. Terkadang meskipun sudah diatur dengan baik anda tetap harus menghadapi masalah.\r\n- Pekerjaan yang cocok adalah child care, perawat, pemerhati anak, bidang agama, akuntan, bidang usaha, dokter keluarga dan konsultan atau konseling keluarga.\r\n\r\nHubungan ESFJ baiknya dengan pribadi yang ISFP atau INFP, dimana mereka sama-sama menggunakan perasaan dalam menentukan berbagai keputusan namun ada juga yang bertolak belakang untuk menyeimbangkan diri.',NULL,'2021-01-21 01:54:19',NULL),(13,'ISTP-A / ISTP-T','Introvert, Sensing, Thinking, Perceiving\r\n\r\nSeseorang yang berkepribadian ISTP sering disebut The Mechanics atau mekanik atau bisa disebut pengrajin. Pribadi yang termasuk ISTP sekitar 4-6% populasi di dunia. Dimana menurut dimensinya ISTP berarti Introversion atau seseorang yang tidak suka akan hubungan dan dunia luar. Sensing yaitu mereka yang mengenal hal-hal secara konkret atau nyata Thinking merupakan dimensi dasar mereka dimana mereka suka menilai dan berpikir sebelum bertindak dan sangat objektif. Perception yakni pemikiran yang terbuka dan cenderung menunda keputusan demi kesepakatan. \r\n\r\nCiri kepribadian ISTP adalah:\r\n- Terus menerus mengumpulkan fakta tentang lingkungan yang ada.\r\n- Memiliki kemampuan yang baik dalam menerapkan logika.\r\n- Turun tangan langsung merupakan cara belajar yang baik.\r\n- Biasanya mampu menguasai teori dan pemikiran yang abstrak.\r\n- Personality (Baca: Big Five Personality) yang cukup kompleks.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Observasi pada kehidupan sosial dan apa yang membuat orang memiliki emosi yang berbeda.\r\n- Belajar untuk mengenali perasaan anda dan mengekspresikannya.\r\n- Jangan mencari kesalahan untuk menyelesaikan masalah.\r\n- Jangan menyimpan informasi yang harusnya dibagikan pada orang lain.\r\n- Pekerjaan yang cocok adalah polisi, ahli forensic, mekanik, pilot, pemahat dan pengusaha.\r\n\r\nAsmara untuk ISTP adalah mereka yang memiliki kepribadian ESTJ atau ENTJ yang bisa meredam dominansi dari sifat ISTP dan menyeimbangkannya.',NULL,'2021-01-21 01:54:36',NULL),(14,'ESTP-A / ESTP-T','Extrovert, Sensing, Thinking, Perceiving\r\n\r\n\r\nAnda yang memiliki kepribadian ESTP biasa disebut sebagai The Doers atau seorang Pelaku. Diperkirakan 4-5% kepribadian ESTP di dunia. Menurut dimensinya ESTP yakni Extroversion yaitu orang yang senang akan jaringan dan hubungan yang luas. Sensing yakni mereka yang berpandangan realistis dan menilai hal dengan konkret. Thinking yaitu mereka yang berpikir objektif tanpa melihat siapapun itu, dan Perception dimana mereka membuat keputusan berdasarkan kesepakatan. \r\n\r\nCiri khas kepribadian ESTP adalah:\r\n- Tidak menyukai hal abstrak, serba cepat dan juga energik.\r\n- Jarang bekerja dengan perencanaan dan senang melakukan hal yang berketerampilan.\r\n- Menyenangkan dan sangat jeli.\r\n- Fleksibel dan tentunya banyak akal.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Belajarlah memahami perasaan orang lain dan cobalah untuk sabar.\r\n- Sesekali luangkan waktu untuk memikirkan masa depan, jangan selalu berpikir anda hidup untuk hari ini.\r\n- Pekerjaan yang cocok adalah wirausaha, tenaga medis, atlet, polisi dan teknik.\r\n\r\nAsmara yang cocok dengan ESTP adalah seseorang yang memiliki kepribadian (Baca: Teori Psikologi Kepribadian)  ISTJ atau ISFJ yang mana tidak akan saling mendominasi dan sama-sama bermodalkan hal yang bersifat sensing atau konkret.',NULL,'2021-01-21 01:54:57',NULL),(15,'ISFP-A / ISFP-T','Introvert, Sensing, Feeling, Perceiving\r\n\r\nSeseorang yang berkepribadian ISFP sering disebut The Artist atau seniman. Ada pribadi yang termasuk ISFP yakni 5-9% populasi di dunia. Dimana menurut dimensinya ISFP berarti Introversion atau seseorang yang tidak suka akan hubungan dan dunia luar. Sensing yaitu mereka yang mengenal hal-hal secara konkret atau nyata.  Feeling yaitu mereka memutuskan berbagai hal dengan perasaan dan menyangkut pribadi serta Perception yakni pemikiran yang terbuka dan cenderung menunda keputusan demi kesepakatan. \r\n\r\nCiri kepribadian ISFP adalah:\r\n- Menyukai pergerakan lambat, suka dengan hal yang dilakukan saat ini dan memiliki kesadaran yang mendalam.\r\n- Tidak suka berurusan dengan teori (Baca: Teori Belajar Kognitif)  dan juga memiliki pemikiran yang konkret\r\n- Setia dan loyal kepada banyak orang.\r\n- Memiliki sifat individualistis dan tidak memiliki keinginan untuk mengikuti siapapun dan tidak suka berorganisasi. (Baca: Psikologi Industri dan Organisasi)\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Jangan takut akan penolakan dan juga konflik, karena hal tersebut wajar terjadi.\r\n- Asah dan kembangkan sisi kreatifitas dan seni dalam diri anda sebagai modal bagus dalam diri anda.\r\n- Pekerjaan yang cocok adalah seniman, guru, dokter hewan, pemerhati anak (Baca: Tahap Perkembangan Emosi Anak) , desainer dan penyanyi.\r\n\r\nAsmara untuk ISFP adalah mereka yang memiliki kepribadian ESFJ atau ENFJ yang mungkin lebih bisa mengimbangi pribadi ISFP.',NULL,'2021-01-21 01:55:17',NULL),(16,'ESFP-A / ESFP-T','Extrovert, Sensing, Feeling, Perceiving\r\n\r\nAnda yang memiliki kepribadian ESFP biasa disebut sebagai The Performers atau seorang pemain. Hanya ada 4-9% kepribadian ESFP di dunia. Menurut dimensinya ESFP adalah Extroversion yaitu mereka yang bisa membangun jaringan dengan luas. Sensing, yakni mereka yang tidak suka akan hal abstrak dan lebih suka hal konkret. Kemudian Feeling, yaitu melibatkan masalah pribadi dalam mengambil keputusan dan terakhir yakni Perception. Dimana mereka lebih menyukai kesepakatan yang diambil dibandingkan menjadi seseorang yang merencanakan segala hal lebih dulu. \r\n\r\nCiri dari kepribadian ESFP adalah :\r\n- Hidup di masa sekarang dengan berpikir realistis serta praktis.\r\n- Spontan dan jarang merencanakan segala sesuatunya.\r\n- Tidak menyukai teori yang panjang dan tahu bagaimana menciptakan hal untuk menyenangkan orang lain.\r\n- Seseorang dengan keterampilan yang cukup baik.\r\n\r\nSaran dan pekerjaan yang cocok:\r\n- Belajarlah menghadapi kritik dan jangan coba untuk lari, apalagi yang menyangkut keputusan dan hal di masa depan.\r\n- Anda cenderung materealitstis jadi cobalah tidak mengukur segala hal dengan uang.\r\n- Pekerjaan yang cocok yakni tenaga penjualan, fotografer, pemerhati anak, decorator, seniman atau aktor.\r\n\r\nAsmara dari ESFP yang cocok adalah mereka yang ISTJ atau ISFJ. Untuk itu, mereka yang memiliki sifat sama-sama memiliki sensing yang baik cocok.',NULL,'2021-01-21 01:55:35',NULL);
